import React, { Fragment } from "react";
import './home.scss'

export function Home() {
  return (
    <Fragment>
      <div className="index">
        <div className="header-sep"></div>
        <div>
          <div className="component1"></div>
          <div className="component2"></div>
          <div className="component3"></div>
          <div className="component4"></div>
        </div>
      </div>
    </Fragment>
  );
}
